def my_func(input1: str):
    if not (1 <= len(input1) <= 20):
        return ""
    words = input1.split(' ')
    result = []
    for word_group in words:
        camel_case = []
        for word in word_group.split('-'):
            camel_case.append(word.capitalize())
        result.append(''.join(camel_case))
    return ' '.join(result)
